import React, { useState }  from 'react'
import LoginPage from '../LoginPage/LoginPage';

const ProfilePage = () => {
    const [token, setToken] = useState();
    if (!token) {
        return <LoginPage setToken={setToken} />
    }
    return (
        <div>
            <h5>Profile</h5>
            <br />
            <p>Name: Elisa Runolfsson</p>
            <p>UserID: 3</p>
        </div>
    )
}

export default ProfilePage
